import axios from "axios";
import React, { useState, useEffect } from "react";

const Test = () => {
  let [test, testChange] = useState();

  const getData = async () => {
    await axios.get("http://localhost:8181/sample/read").then((result) => {
      testChange(result.data);
    });
  };

  let temp_data;

  useEffect(() => {
    getData();
  }, []);

  return (
    <div>
      <p id="one">오늘 크롤링은 어ㅓ셨나요?</p>
      <p id="two">괜츈?</p>
      <button
        onClick={() => {
          console.log(test);

          let one = document.getElementById("one");
          let two = document.getElementById("two");

          one.innerHTML = test.name;
          two.innerHTML = test.age;
        }}
      >
        ajaxRead
      </button>
      <button
        onClick={async () => {
          await axios
            .post("http://localhost:8181/sample/update", {
              name: test.name,
              age: test.age + 1,
            })
            .then((result) => {
              console.log("update!");
            });

          await getData();
        }}
      >
        ajaxUpdate
      </button>
    </div>
  );
};

export default Test;
